import React, { Component } from "react";

class StravaExport extends Component {
  state = {};
  render() {
    return (
      <div>
        <a href="http://www.strava.com/oauth/authorize?client_id=47805&response_type=code&redirect_uri=http://localhost:3000/strava/exchange_token&approval_prompt=force&scope=read">
          Authorization
        </a>
      </div>
    );
  }
}

export default StravaExport;
